import React from 'react'
import {useCharacters} from '../../hooks'
import {Character} from '../../hooks/Comic'
import SectionTitle from '../UI/Typoraphy'

interface CharactersProps {
  characters: Character[]
}

function Characters({characters}:CharactersProps){
  const {data, isLoading} = useCharacters(characters)
  return <SectionTitle>Characters</SectionTitle>
}
